import React, { useState } from "react";

export const Home = (props) => {

    function Card() {
    return (
        <div class="card">
            <div class="card-top">
                <h1>Card </h1>
            </div>
            <div class="card-body">
                <img src="/logo192.png" alt="card"></img>
            </div>
            <div>
                <p> Card component rendered inside a container </p>
            </div>
        </div>
        );
    }

    return (
        <div className="home-container">
            <h2>Home Page</h2>
            <div className="card-container">
                <Card />
                <Card />
                <Card />
            </div>
        </div>
    )
}
